  false,\n\t\"url\": null,\n\t\"notes\": \"The Local Area Unemployment Statistics
  program estimates labor force statistics (labor force, employed, unemployment, unemployment
  rate) for New York State civilian labor force aged 16 and up. Areas covered include,
  New York State, New York City, Balance of State, Metropolitan Statistical Areas,
  Counties, Labor Market Regions, Workforce Investment Board Areas, and cities and
  towns with populations of 25,000 or more. Data are not seasonally adjusted. Civilian
  labor force data do not include military, prison inmate, or other institutional
  populations.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
